import{_ as e,o as t,c as a,O as i}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 51.1-617 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/51.1-617.md","filePath":"vacode/51.1-617.md"}'),o={name:"vacode/51.1-617.md"},n=i('<h1 id="§-51-1-617-definitions" tabindex="-1">§ 51.1-617 Definitions. <a class="header-anchor" href="#§-51-1-617-definitions" aria-label="Permalink to &quot;§ 51.1-617 Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context requires a different meaning:</p><p>&quot;Board&quot; means the Board of Trustees of the Virginia Retirement System.</p><p>&quot;Eligible employee&quot; means any turnaround specialist or member of the middle school teacher corps providing services for a participating public school division pursuant to subsections E and F of § <a href="/vacode/22.1-199.1/">22.1-199.1</a>.</p><p>&quot;Participating employer&quot; means any local public school board that offers and pays the costs of improved retirement benefits as described in subsections E and F of § <a href="/vacode/22.1-199.1/">22.1-199.1</a>.</p><p>&quot;Plan&quot; means the defined contribution plan established pursuant to this chapter and the provisions of § 401 (a) of the Internal Revenue Code of 1986, as amended.</p><p>&quot;Qualified participant&quot; means an eligible employee of a participating employer.</p><p>2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0436" target="_blank" rel="noreferrer">436</a>; 2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0861" target="_blank" rel="noreferrer">861</a>.</p>',8),r=[n];function s(p,c,l,d,f,h){return t(),a("div",null,r)}const m=e(o,[["render",s]]);export{_ as __pageData,m as default};
